import React from "react";
const CourseTableHead = () => {
  return (
    <div className="container">
      <thead>
        <tr>
          <th>Course Name</th>
          <th>Date</th>
          <th>Credits</th>
          {/* <th>Button</th> */}
        </tr>
      </thead>
    </div>
  );
};

export default CourseTableHead;
